import React, { useState } from 'react'

function Contact() {
  const Counter = () => {
    const [count, setCount] = useState(7)

    return (
      <div>
        <p>You clicked {count} times</p>
        <button onClick={() => setCount(count + 1)}>Click me</button>
      </div>
    )

}
  return (
    <section id="contact">Contact

    <Counter/>
    </section>

    )
  }

export default Contact
